  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom'

class Root extends Component {
  render() {
    return (
      <div className="App-intro">
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/messages" component={Messages} />
            <Route path="/about" component={About} />
            <Redirect to="/" />
          </Switch>
        </div>
    );
  }
}

export default Root
